leau User Interface</span><br /><br />\n              <strong>Hands-On:</strong><br />Installation of Tableau\n              </div>\n          </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse2\">Session – 2: Data Connection with Tableau Desktop <i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse2\">\n            <div class=\"panel-body\">\n              <strong>Learning Objective:</strong>\n              <br />\n              Get a brief idea on Tableau UI components and various ways to establish data connection.<br /><br />\n              <strong>Topics:</strong><br/>\n              <span>Features of Tableau Desktop</span><br />\n              <span>Connect to data from File and Database</span><br />\n              <span>Types of Connections (Live v/s Extract)</span><br />\n              <span>Data Type</span><br />\n              <span>View Data</span><br />\n              <span>Column Formatting</span><br />\n              <span>Dimensions and Measures understanding</span><br />\n              <span /><br />\n              <strong>Hands-On:</strong><br />Basic project: Create a workbook and Basic charts\n              </div>\n          </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse3\">Session - 3: Basic Visual Analytics and Visualization (1)<i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse3\">\n            <div class=\"panel-body\">\n              <strong>Learning Objective:</strong>\n              <br />\n              Understand the importance of Visual Analytics and explore the various charts, features and techniques used for Visualization.<br /><br />\n              <strong>Topics:</strong><br/>\n              <span>Joins and Unions</span><br />\n              <span>Data Blending </span><br />\n              <span>Bar Chart (Horizontal, vertical and side by side)</span><br />\n              <span>Line Chart (Single & Dual)</span><br />\n              <span>Pie Chart</span><br />\n              <span>Symbol Map, Maps and Tree Map chart</span><br />\n              <span>Word Cloud</span><br />\n              <span>Packed Bubble Chart</span><br /><br />\n              <strong>Hands-On:</strong><br />Basic project: Practice session on above charts\n              </div>\n          </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse4\">Session - 4 : Basic Visual Analytics and Visualization (2)<i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse4\">\n            <div class=\"panel-body\">\n              <strong>Learning Objective:</strong>\n              <br />\n              Understand the importance of Visual Analytics and explore the various charts, features and techniques used for Visualization.<br /><br />\n              <strong>Topics:</strong><br/>\n              <span>Hierarchy Distribution</span><br />\n              <span>Data Granularity</span><br />\n              <span>Sorting</span><br />\n              <span>Grouping</span><br />\n              <span>Discrete V/s Continuous </span><br />\n              <span>Funnel chart </span><br />\n              <span>Calendar Chart</span><br />\n              <span>Matrix, Heatmap and Highlighted Tables</span><br /><br />\n              <strong>Hands-On:</strong><br />Basic project: Practice session on above charts\n              </div>\n          </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse5\">Session -5: Working with some Advance Charts and Diagram<i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse5\">\n            <div class=\"panel-body\">\n              <strong>Learning Objective:</strong>\n              <br />\n              Deep dive into Visual Analytics in a more granular manner. It covers various advanced techniques for analysing data that includes Forecasting, Trend Lines, Reference Lines, Clustering, and Parameterized concepts.<br /><br />\n              <strong>Topics:</strong><br/>\n              <span>Filters - Text, Number, Date, Data source, Extract</span><br />\n              <span>Table calculation and Quick Table calculation</span><br />\n              <span>Table formatting (Size, color, label, shading, font, alignment and tooltip)</span><br />\n              <span>Lollipop Chart</span><br />\n              <span>Map with Pie</span><br />\n              <span>Dual axis & Synchronized axis concept </span><br />\n              <span>Calendar Chart</span><br />\n              <span>Matrix, Heatmap and Highlighted Tables</span><br />\n              <span>Bar in Bar, Bar with Line and Bar vs Shape</span><br />\n              <span>Line vs Shapes</span><br /><br />\n              <strong>Hands-On:</strong><br />Basic project: Practice session on above charts\n              </div>\n          </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse6\">Session – 6: Calculation in Tableau <i class=\"fa fa-sort-down\"></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse6\">\n            <div class=\"panel-body\">\n              <strong>Learning Objective:</strong><br />\n              Understand basic calculations such as Numeric, String Manipulation, Date Function, Logical and Aggregate. You will also get introduced to Table Calculations and Level Of Detail (LOD) expressions.<br />\n              <br /><strong>Topics:</strong><br/>\n              <span>Type of calculation</span><br />\n              <span> Type of calculation</span><br />\n              <span>Inbuild functions (Number, String, Date, Logical and Aggregate)</span><br />\n              <span>Table Calculation (Advanced)</span><br />\n              <span>Compute Using and Measures feature</span><br />\n              <span>Parameter and Sets Usage</span><br />\n              <span>Reference line Chart</span><br />\n              <span>LOD (Level of Details Calculation) – Introduction </span><br /><br />\n              <strong>Hands-On:</strong><br />Basic project: Practice session on above charts\n            </div>\n          </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse7\">Session -7: Advance Visual Analytics<i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse7\">\n            <div class=\"panel-body\"><strong>Learning Objective:</strong><br />Deep dive into Visual Analytics in a more granular manner. It covers various advanced techniques for analysing data that includes Forecasting, Trend Lines, Reference Lines, Clustering, and Parameterized concepts\n            <br /><br /><strong>Topics:</strong><br/></div>\n            <span> I. Trend lines</span><br />\n            <span>II. Reference lines (Lines, band, distribution and Boxplot)</span><br />\n            <span>III. Forecasting (Time series data, prediction and equation)</span><br />\n            <span>IV. Clustering</span><br /><br />\n            <strong>Hands-On:</strong><br />Basic project:\n        </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse8\">Session -8: Level of Detail (LOD) Expressions in Tableau<i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse8\">\n            <div class=\"panel-body\"><strong>Learning Objective:</strong><br />Deep dive into advanced analytical scenarios, using Level Of Detail expressions.\n            <br /><br /><strong>Topics:</strong><br/></div>\n            <span> I. Use Case I - Count Customer by Order</span><br />\n            <span> II. Use Case II - Profit per Business Day</span><br />\n            <span> III. Use Case III - Comparative Sales</span><br />\n            <span> IV. Use Case IV - Profit Vs Target</span><br />\n            <span> V. Use Case V - Finding the second order date</span><br />\n            <span> VI. Use Case VI - Cohort Analysis</span><br /><br />\n            <strong>Hands-On:</strong><br />Basic project: Practice session on LOD Expressions\n        </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse9\">Session -9: Advanced Charts in Tableau<i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse9\">\n            <div class=\"panel-body\"><strong>Learning Objective:</strong><br />Learn to plot various advanced charts in Tableau Desktop.\n            <br /><br /><strong>Topics:</strong><br/></div>\n            <span> I. Box and Whisker’s Plot</span><br />\n            <span> II. Bullet Chart</span><br />\n            <span> III. Gantt Chart</span><br />\n            <span> IV. Waterfall Chart</span><br />\n            <span> V. Pareto Chart</span><br />\n            <span> VI. Control Chart</span><br />\n            <span> VII. Funnel Chart</span><br />\n            <span> VIII. Bump Chart</span><br />\n            <span> IX. Step and Jump Lines</span><br />\n            <span> X. Word Cloud</span><br />\n            <span> XI. Donut Chart</span><br /><br />\n            <strong>Hands-On:</strong><br />Basic project: Advance charts in Tableau practice session\n        </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse10\">Session-10: Geographic Visualizations in Tableau<i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse10\">\n            <div class=\"panel-body\"><strong>Learning Objective:</strong><br />Gain an understanding of Geographic Visualizations in Tableau.\n            <br /><br /><strong>Topics:</strong><br/></div>\n            <span> I. Introduction to Geographic Visualizations</span><br />\n            <span> II. Manually assigning Geographical Locations</span><br />\n            <span> III. Types of Maps</span><br />\n            <span> IV. Spatial Files</span><br />\n            <span> V. Custom Geocoding</span><br />\n            <span> VI. Polygon Maps</span><br />\n            <span> VII. Web Map Services</span><br />\n            <span> VIII. Background Images</span><br /><br />\n            <strong>Hands-On:</strong><br />Basic project: Create a workbook and publish it on Tableau Online\n        </div>\n        </div>\n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse11\">Session-11: Dashboards and Stories <i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse11\">\n            <div class=\"panel-body\"><strong>Learning Objective:</strong><br />Build Dashboards and Stories within Tableau.\n            <br /><br /><strong>Topics:</strong><br/></div>\n            <span> I. Introduction to Dashboards</span><br />\n              <span> II. The Dashboard Interface</span><br />\n              <span> III. Dashboard Objects</span><br />\n              <span> IV. Building a Dashboard</span><br />\n              <span> V. Extensive filters of Dashboard</span><br />\n              <span> VI. Dashboard Layouts and Formatting</span><br />\n              <span> VII. Interactive Dashboards with actions</span><br />\n              <span> VIII. Designing Dashboards for devices</span><br />\n              <span> IX. Story Points</span><br /><br />\n              <strong>Hands-On:</strong><br />Basic project: Create a workbook and publish it on Tableau Online\n        </div>\n          </div>\n        \n        <div class=\"panel panel-default\">\n          <div class=\"panel-heading\">\n            <h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse12\">Session-12: Exploring Tableau Online<i class=\"fa fa-sort-down\" ></i></a></h4>\n          </div>\n          <div class=\"panel-collapse collapse\" id=\"collapse12\">\n            <div class=\"panel-body\"><strong>Learning Objective:</strong><br />Learn to publish data, interact, modify, and secure the published data on Tableau Online.\n            <br /><br /><strong>Topics:</strong><br/></div>\n            <span> I. Publishing Workbooks to Tableau Online</span><br />\n            <span> II. Interacting with Content on Tableau Online</span><br />\n            <span> III. Tableau Mobile</span><br />\n            <span> IV. Case Studies: (any3)</span><br />\n            <span>&nbsp;&nbsp;&nbsp;&nbsp;a. Bank Loan Dataset</span><br />\n            <span>&nbsp;&nbsp;&nbsp;&nbsp;b. Dmart Sales & Marketing Campaign Dataset</span><br />\n            <span>&nbsp;&nbsp;&nbsp;&nbsp;c. Automobile Dataset</span><br />\n            <span>&nbsp;&nbsp;&nbsp;&nbsp;d. IBM HR Analytics</span><br />\n            <span>&nbsp;&nbsp;&nbsp;&nbsp;e. Election 2019 Analysis </span><br /><br />\n            <strong>Hands-On:</strong><br />Basic project: Create a workbook and publish it on Tableau Online\n        </div>\n        </div>\n      </div>\n      <p class=\"sub-heading\"><strong>Schedule of classes</strong></p>\n      <div>\n        <strong> <u>20 June &nbsp;&nbsp; (Sat - Day 1)</u></strong><br />\n        <span>08:00 AM - 09:00 AM &nbsp;&nbsp;&nbsp;&nbsp; Introduction</span><br />\n        <span>09:00 AM - 11:00 AM &nbsp;&nbsp;&nbsp;&nbsp; First Training Session</span><br />\n        <span>11:00 AM - 12:00 PM &nbsp;&nbsp;&nbsp;&nbsp; Practical Lab</span>\n        <br />\n        <br />\n        <strong><u>21 June - 26 July &nbsp;&nbsp;(Only Sat-Sun ,11 Days) </u></strong><br />\n        <span>08:00 AM - 09:00 AM &nbsp;&nbsp;&nbsp;&nbsp; Doubt Session</span><br />\n        <span>09:00 AM - 11:00 AM &nbsp;&nbsp;&nbsp;&nbsp; Training Session</span><br />\n        <span>11:00 AM - 12:00 PM &nbsp;&nbsp;&nbsp;&nbsp; Practical Lab</span>\n        <br />\n        <br />\n        <strong><u>01 Aug &nbsp;&nbsp; Sat</u></strong><br />\n        <span>10:00 AM - 11:00 AM &nbsp;&nbsp;&nbsp;&nbsp; Online Examination</span>\n        <br />\n        <br />\n        <strong><u>02 Aug &nbsp;&nbsp; Sun</u></strong><br />\n        <span>10:00 AM - 11:00 AM &nbsp;&nbsp;&nbsp;&nbsp; Convocation</span><br />\n\n      </div>\n    </div>\n\n',1,NULL,'-330',NULL,'wss://api.classtree.in?sessionId=98&token=tok_CSkXNJNMFqad17uc&role=MODERATOR&version=2.14.0','All Levels','Finance & Accounting','course','Sat-Sun',12,12,'<br/><p>1. Should have a Laptop/Desktop , if needs to do practical along with videos.</p>\n<p>2. Installed Tableau Desktop. Download by&nbsp;<a style=\"color: #0f7c90;\" title=\"Tableau Download\" href=\"https://www.tableau.com/en-in/products/desktop/download\">clicking here<br /></a></p>\n<p>3. Basic softwares - Powerpoint , Excel, PDF Reader</p>\n<p>4. Notepad and Pen</p>\n<p><strong>5. PASSION TO LEARN</strong></p>','2020-06-01 11:45:50','2020-06-21 05:38:20'),(105,'Corporate Trainer','05:00 PM',NULL,'formyscholars4u@gmail.com','Learn to Code : The Complete Core Java Course','2020-07-06 01:30:00','9999999999',NULL,17,'USD 160',178,'<p><strong>Learn to Code : The Complete Core Java Course in 30-40 Classes</strong></p>\r <p style=\"color: #0f7c90; margin-top: 20px;\"><strong>Description</strong></p><p>This program is curated by professionals as per the industrial requirements and demands. This training encompasses comprehensive knowledge on basic and breakthrough concepts of core Java. It will give you a complete understanding of Java. You will be gone through simple and practical approaches while learning Java language. It\'s going to be in a simple and effective manner so you won&#39;t face any difficulty while learning.</p>\r <p style=\"color: #0f7c90; margin-top: 20px;\"><strong>Why should you learn JAVA?</strong></p><ul style=\"list-style-type: circle;\"> <li style=\"padding: 5px 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px;\">Rated #1 in TIOBE Popular programming languages index (15th Consecutive Year)</li> <li style=\"padding: 5px 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px;\">Used by 10 Million developers worldwide to develop applications for 15 Billion devices supporting Java &nbsp;</li> <li style=\"padding: 5px 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px;\">Average Salary of professionals with Java skills is $110k (Indeed salary data) &nbsp;</li><li style=\"padding: 5px 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px;\">Real-World Applications &nbsp;</li><li style=\"padding: 5px 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px;\">Future Market &nbsp;</li></ul><p style=\"color: #0f7c90; margin-top: 20px;\"><strong>Curriculum</strong></p><p><strong>INTRODUCTION OF JAVA</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">1. History of JAVA</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">2. Features of JAVA</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">3. Setting up path</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">4. Working with Java</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">5. Basic Syntax</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">6. Variable and Data Types&nbsp;<ul>\r         <li>&nbsp;Installation</li>\r         <li><span style=\"white-space:pre;\">&nbsp;</span>Hello World Program</li>\r         <li>&nbsp;Command line argument</li>\r         <li>&nbsp;Objects and class</li>\r         <li>&nbsp;User defined program</li>\r     </ul>\r </div>\r <p><strong>INTRODUCTION TO IDEs</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">7. IDLE&nbsp;<ul>\r         <li>&nbsp;Eclipse</li>\r         <li><span style=\"white-space:pre;\">&nbsp;Netbeans</span></li>\r     </ul>\r </div>\r <p><strong>OPERATORS</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">8. Arithmetic&nbsp;</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">9. Relational</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">10. Logical</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">11. Bitwise</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">12. Assignment&nbsp;</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">13. Precedence and associativity</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Conditional Statements</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">14. If&nbsp;</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">15. If- else&nbsp;</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">16. Nested if-else</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Looping&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">17. For</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">18. While&nbsp;</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">19. Nested loops</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Switch Statement &nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">20. Switch Statement&nbsp;</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">MultiThreading&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">21. MultiThreading</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Collections (Array)&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">22. Collections (Array)</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">OOPs Concept&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">23. &nbsp;Inheritance</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">24. &nbsp;Polymorphism</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">25. Abstract Class</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">26. Encapsulation</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">27. &nbsp;Overriding</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">28. Overloading</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Functions&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">29. Defining a function</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">30. Calling a Function</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">31. Types of Functions</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">32. Function Arguments</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">33. Global and Local Variables</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Constructors&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">34. Default</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">35. Parameterized&nbsp;</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Strings&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">36. Creation</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">37. Concatenation&nbsp;</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">38. Comparision</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">39. StringBuffer class&nbsp;</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">40. charAt(),setCharAt()</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">41. delete(),deleteCharAt()</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Packages&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">42. Introduction</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">43. Subpackages</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Exception Handling&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">44. Try-Catch</div>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">45. Throw &amp; throws&nbsp;</div>\r <p style=\"margin-bottom: 10px !important;  widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: 700;\">Mini Project&nbsp;</strong></p>\r <div style=\"padding: 5px 15px; border: 1px solid lightgray;\">46. Mini Project<br>&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Live project based on any of the selected use cases based on real life, involving Industry concepts of Java</br></div>\r <p style=\"color: #0f7c90; margin-top: 20px;\"><strong>Schedule of classes</strong></p>\r <p style=\"padding: 5px 10px; margin: 0px;\"><strong>30-40 Classes</strong> starting from <strong>June 15, 2020 Monday</strong></p>\r <p style=\"padding: 5px 10px; margin: 0px;\">Mon-Fri &nbsp; &nbsp; &nbsp; 07:00 AM - 08:00 AM</p>\r ',1,NULL,'-330',NULL,NULL,'All Levels','Technology','course','Mon-Fri',30,30,'<br/><p>Don\'t have coding knowledge? Don\'t worry that\'s not a pre-requisite. </p><p>1. Should have a Laptop/Desktop , if needs to do practical along with videos.</p> <p>2. Notepad and Pen</p> <p><strong>3. PASSION TO LEARN</strong></p>','2020-06-03 19:07:05','2020-06-28 11:10:42'),(106,'Shravan Kumar Veldurthi','05:00 PM',NULL,'hazarifahad@gmail.com','Machine Learning with Python ','2020-07-18 14:30:00','8105778745',NULL,20,'USD 20 / hour',185,'Machine learning is one of the most popular profession, with lot of job openings with hand some  salary.  Enter at right time to grab those opportunities ',1,NULL,'-330',NULL,NULL,'All Levels','Technology','course','Daily',50,50,'12 standard maths','2020-06-15 06:21:18','2020-06-28 11:19:35'),(108,'Fahad','05:00 PM',NULL,'hazarifahad@gmail.com','Data Science - Deep Learning and NLP','2020-07-13 16:30:00','8825095803',NULL,1,'USD 30 / hour',185,'If you want to break into AI, this specialisation will help you do so. Deep Learning is one of the most highly sought after skills in tech. We will help you become good at Deep Learning.\n\nIn 2month course, you will learn the foundations of Deep Learning, understand how to build neural networks, and learn how to build successful AI chatbots. ',1,NULL,'-330',NULL,NULL,'All Levels','Science','course','Daily',60,60,'Basic knowledge of Machine Learning and Data Analytics','2020-06-21 05:34:59','2020-06-28 11:18:18');
