INSERT INTO `Class1` VALUES (38,'Test','18:15:00','18:40:00','garima795jain@gmail.com','Testing','2020-05-01 06:25:00','9283749827',NULL,5,0,'Testing..',1,NULL,'-330','wss://api.classtree.in?sessionId=38&token=tok_OmmK3SblHn2MHacR&role=MODERATOR&version=2.13.0','2020-04-29 11:20:30','2020-05-26 07:42:47'),(39,'Pooja Verma','17:15:00','17:45:00','garima795jain@gmail.com','CAT Tricks - Close','2020-04-07 18:30:00','9827349234',NULL,5,0,'CAT (Common Admission Test) is the premier all India management entrance exam conducted by IIMs. Last year 2,04,267 students competed for 1550+ seats making it the most competitive exam in the country.',0,NULL,'-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(40,'Swati Jain','17:00:00','17:30:00','swati.net.se@gmail.com','Javascript Advance','2020-04-16 18:30:00','9238974387',NULL,10,0,'I am Swati..I have 8 yrs of experience and want to share learning my learning on js advance',0,NULL,'-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(41,'Lavanya Sharma','11:00:00','12:00:00','swati.net.se@gmail.com','How to enhance productivity','2020-04-11 18:30:00','8121462212',NULL,10,0,'Step by step instructions for raising productivity.\nGreat for entry level IT professionals',0,NULL,'-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(42,'CA CS Sweety Jain','20:00:00','20:40:00','sweetysj18@gmail.com','GST Amendments','2020-04-06 14:30:00','9346638364',NULL,50,0,'I will be sharing my insight on GST Amendments. Key points :  1. Due date of GSTR 3B & 1 not extended. 2. Covid-19 impact on GST compliance. 3. Changes in GST registration   4. Relaxation in GST refund  5. Deferment of ITC restrictions',0,NULL,'-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(43,'Amit Roy','15:25:00','15:55:00','teacher678@gmail.com','Yoga Instructor','2020-04-16 18:30:00','9238749287',NULL,5,0,'Skilled and passionate Yoga Instructor certified in Vinyasa and Ashtanga styles. Able to read and adjust to students energy to create a personalized, safe and deeply supportive practice',0,NULL,'-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(47,'Ankush Bansal','18:00:00','19:00:00','ankuvit@gmail.com','Product Marketing','2020-04-12 12:30:00','8447737294',NULL,15,0,'Working as a Product Marketing Manager with Flipkart',0,'https://us04web.zoom.us/j/656850248?pwd=SFlWazU2QmVQcFNUVklHbDVxYjdMZz09','-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(52,'Shikha jain','02:00 PM',NULL,'shikha15biotech@gmail.com','Flow cytometry','2020-04-17 08:30:00','8708046914',NULL,40,0,'Flow cytometry is related to separation of cells on the basis of different properties. It is an analysis technique related to cell biology',0,'https://us04web.zoom.us/j/74509069283?pwd=NmZLZHlCUDk1aGMxaEhOcGNNalIzQT09','-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(53,'soma venkateswararao','04:00 AM',NULL,'somavenkateswararao@gmail.com','Website designing','2020-04-17 22:30:00','9397303455',NULL,40,0,'I have 7 years experience in marketing',0,NULL,'-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(54,'MeenakshiStephen','06:00 PM',NULL,'manoharimeenakshi1904@gmail.com','Polymerase chain Reaction ','2020-04-22 12:30:00','7708772815',NULL,30,0,'Polymerase chain reaction (PCR) is a method used widely in molecular biology to make millions to billions of copies of a specific DNA sample rapidly, allowing scientists to take a very small sample of DNA and amplify it to a large enough amount to study in detail.',0,'https://us04web.zoom.us/j/72414909984','-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(55,'Virendra Kumar Pandey','05:00 PM',NULL,'pandeyvirendra193@gmail.com','Virus in Food','2020-04-25 11:30:00','8462890636',NULL,40,0,'Virus is an interlink between living and non living. During the lecture we will cover Virus and it\'s metabolism along with associated Food broke viruses.',0,'https://us04web.zoom.us/j/73456162367','-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(56,'MeenakshiStephen','06:00 PM',NULL,'manoharimeenakshi1904@gmail.com','Basics of Microbiology','2020-04-27 12:30:00','7708772815',NULL,30,0,'A fundamental understanding of how a cell works has come through the study of microorganisms. But microbiology also is an applied science, helping agriculture, health and medicine and maintenance of the environment, as well as the biotechnology industry. ',0,'https://us04web.zoom.us/j/76044063429','-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(57,'Yogaholic Amit','04:00 PM',NULL,'toyogaholicamit@gmail.com','Yoga and Ayurveda','2020-05-05 13:00:00','9910225023',NULL,80,0,'Namaste everyone.Its been 16 years since I am practicing Yoga and Ayurveda.I have been guiding people about Yoga and Ayurveda in corporate offices as well as in person. Lets learn about how to keep yourself fit Mentally, Physically and Spritiually through Yoga practice and eating in the right way.',0,NULL,'-330','wss://api.classtree.in?sessionId=57&token=tok_QEG8uj4VNMXmCTMZ&role=PUBLISHER&version=2.13.0&coturnIp=139.59.33.176&turnUsername=LUMFTV&turnCredential=grghv1','2020-04-29 11:20:30','2020-05-05 14:00:23'),(58,'Sweety Jain','02:00 PM',NULL,'sweetysj18@gmail.com','How to excel in EXCEL','2020-05-03 08:30:00','9346638364',NULL,40,0,'Excel is basic and most important software which if used can increase your efficiency and can reduce the error',0,NULL,'-330','wss://api.classtree.in?sessionId=58&token=tok_Ijgo5jlXQX0NXGy5&role=PUBLISHER&version=2.13.0&coturnIp=139.59.33.176&turnUsername=YR8EKH&turnCredential=q9ve2f','2020-04-29 11:20:30','2020-05-03 09:07:59'),(62,'Nisha singh','06:00 PM',NULL,'sweetdove.16@gmail.com','Managing self and others','2020-04-29 12:30:00','7903876174',NULL,100,0,'This is about how to be Positive and manage self and others during the lockdown ensuring high productivity.',0,'https://us04web.zoom.us/j/72589132261','-330',NULL,'2020-04-29 11:20:30','2020-04-29 13:37:26'),(66,'Sanmugavel.S','05:00 PM',NULL,'suryabiotech17@gmail.com','Food preservation Methods','2020-04-23 11:30:00','8098425932',NULL,80,0,'In this webinar you would able to learn some methods and techniques which industries follows to preserve food.',0,'https://us04web.zoom.us/j/74560087867','-330',NULL,'2020-04-29 11:20:30','2020-04-29 11:20:30'),(67,'Piyush Kant Rai','08:00 PM',NULL,'raipro556@gmail.com','Basics of Bioinformatics','2020-05-04 14:30:00','9953913169',NULL,60,0,'This lecture will cover basics of Bioinformatics including computational biology, system biology, databases and their application.',0,NULL,'-330','wss://api.classtree.in?sessionId=67&token=tok_L3KxpDSRHn0LhiQB&role=PUBLISHER&version=2.13.0&coturnIp=139.59.33.176&turnUsername=KMGF0R&turnCredential=2hap11','2020-04-29 11:20:30','2020-05-04 18:42:36'),(68,'Gaurav Aggarwal','05:00 PM',NULL,'bioinfo.ga@gmail.com','Hands on Online docking ','2020-05-17 06:30:00','9899063198',NULL,40,0,'This interactive session will cover docking of protein molecules with compound. We will perform all this using internet and desktop.\nSoftwares require -\n1. PYMOL student version\n2. Openbabel',0,NULL,'-330','wss://api.classtree.in?sessionId=68&token=tok_NMdqfI7tcXxoni67&role=MODERATOR&version=2.13.0&coturnIp=139.59.33.176&turnUsername=MODOPW&turnCredential=lwi1xe','2020-04-29 11:20:30','2020-05-17 07:12:07'),(70,'Sasikala','04:00 AM',NULL,'sriacharyayoga@gmail.com','Yoga Class','2020-05-04 10:30:00','9148081371',NULL,80,0,'I am Sasikala your Yoga Teacher. I have completed master degree in yoga as well as yoga therapy. I am expert  in hata yoga, astanga Yoga. Pre Natal yoga, post Natal yoga etc.',0,NULL,'-330','wss://api.classtree.in?sessionId=70&token=tok_QFoEX6xn8AlATlkC&role=PUBLISHER&version=2.13.0&coturnIp=139.59.33.176&turnUsername=YHWPDE&turnCredential=wsqxfe','2020-04-30 08:50:11','2020-05-04 11:18:34'),(71,'Sweety Jain','05:00 PM',NULL,'sweetysj18@gmail.com','Advance Excel','2020-05-23 11:30:00','9346638364',NULL,80,0,'You can expect to learn\n1. How to make template attractive\n2. Vlookup, 