sson we will learn about quantum physics in biology and it\'s role in recent advancement in the field of biology',1,NULL,'-330','wss://api.classtree.in?sessionId=80&token=tok_KyXp5lF3X0tayCms&role=MODERATOR&version=2.13.0','2020-05-11 07:20:31','2020-05-31 12:21:28'),(81,'Smruthi','09:00 AM',NULL,'smruthikulkarni145@gmail.com','Full course on Web designing and Ms office','2020-05-17 03:30:00','8861957563',NULL,80,0,'There would be 50-60 classes. Classes would start on May 17. I have experience in computer programming and interested to teach the students for their future.',0,NULL,'-330',NULL,'2020-05-11 13:46:42','2020-05-12 16:59:21'),(86,'subham p','05:00 PM',NULL,'shubhamagra2026@gmail.com','English - Noun','2020-05-23 11:30:00','9027593862',NULL,80,0,'Grammer - Noun is important part of english.',0,NULL,'-330',NULL,'2020-05-15 07:51:03','2020-05-22 18:15:33'),(88,'Deekshan','08:00 PM',NULL,'deekshanbakshi@gmail.com','javasript','2020-05-24 14:30:00','9136394228',NULL,10,0,'Hi! I am Deekshan Bakshi, your javascript teacher and I have done B-TECH & M-TECH and have done a course from congixia, GoTraining, and udemy.I have a good experience with the computer. Javascript will give you a good experience and help you in designing games. It will increase your logical thinking',0,NULL,'-330',NULL,'2020-05-17 09:48:40','2020-05-24 06:29:31'),(90,'Ashish Upadhyay','05:00 PM',NULL,'ashishgpb86@gmail.com','Fundamentals of Genetics','2020-05-20 11:30:00','7505947501',NULL,100,0,'Genetics - Sex determination and sex linkage concept. We will cover the entire B Sc Agriculture Ist Year students on Fundamental of Genetics. We will update you the class schedules soon.',0,NULL,'-330',NULL,'2020-05-17 12:47:35','2020-05-20 13:51:49'),(91,'Baviya','02:00 PM',NULL,'studyonlinego1@gmail.com','Java(Core) - Session 1 ','2020-05-31 08:30:00','9941925823',NULL,30,0,'Full course on Java(CORE) on every sunday.\nplease find the timings below\nFirst session at 2 pm to 3 pm.\nSecond session at 4 