ormatics. It is being 4 years and more since I am bioinformatician. I have worked as data analyst in private sector for 2 years','Piyush Kant Rai','9953913169',NULL,'raipro556@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 18:16:11'),(162,'small','online','I have experience in the Interdisciplinary field of Bioinformatics, Biotechnology, and Nanomedicine. I have one International conference research paper. I adapted to teach bioinformatics where math meets molecules.\nFeel free to connect-\nLinkedln: https://in.linkedin.com/in/gaurav-aggarwal-8397b7141\n','Gaurav Aggarwal','9899063198',5,'bioinfo.ga@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-06-12 10:00:56'),(163,NULL,NULL,NULL,'Sasikala','9148081371',NULL,'sriacharyayoga@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 15:23:00'),(166,NULL,NULL,NULL,'ClassTree','99999999',NULL,'classtreecare@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 15:23:00'),(167,NULL,NULL,NULL,'Sanjeet Jha','8106007760',NULL,'sanjeetjh@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 15:23:00'),(168,'zero','online','Java programming language - to crack interview easily.\nI have 10+ years of experience ','Baviya','9941925823',5,'studyonlinego1@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-06-04 12:20:20'),(169,NULL,NULL,NULL,'bittusaraluke','9895608154',NULL,'bittu.at.work@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 15:23:00'),(170,NULL,NULL,NULL,'Smruthi','8861957563',NULL,'smruthikulkarni145@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 15:23:00'),(171,NULL,NULL,NULL,'subham p','9027593862',NULL,'shubhamagra2026@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 15:23:00'),(172,NULL,NULL,NULL,'Deekshan','9136394228',NULL,'deekshanbakshi@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 15:23:00'),(173,NULL,NULL,NULL,'Ashish Upadhyay','7505947501',NULL,'ashishgpb86@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 15:23:00'),(174,NULL,NULL,NULL,'Ajay Dhar','00917838794233',NULL,'ajaydhar6@gmail.com','-330',NULL,'2020-05-31 15:23:00','2020-05-31 15:23:00'),(177,'online','large','<p>Fascination is one word that describes my curiosity to understand the world around Shubham Palwani</p>\n<p>Shubham is a highly skilled and self motivated trainer who has expertise in various business intelligence tools like Power BI, Tableau and Microsoft Excel.</p>\n<p>He comes with 10 years of experience in training individuals in different industry sectors like Banking, Finance, Healthcare, IT, Automobile, Manufacturing and Pharmaceutical. His major clients include Mercedes-Benz, Loreal, IBM, L&amp;T, Wipro, Bajaj Finance, ITC, DHL, Deutsche Bank, Yes Bank, ITC, Mahindra, Morgan Stanley, Deloitte etc. that are spread across globe in regions like India, Kenya, Rwanda, Kigali, Singapore, Dubai, Malaysia, Muscat, Doha, Vietnam, Indonesia, China and Hong Kong.</p>\n<p>He believes in providing end to end solution through his training and is himself responsible for designing the course content, quizzes, online training, clarifying doubts and any additional help required by students to master the tool and attain certification.</p>','Shubham Paliwal',NULL,NULL,'paliwal16.shubham@gmail.com','-330',NULL,'2020-06-01 11:38:24','2020-06-07 16:46:54'),(178,'small','professional','All our instructors are world class corporate trainers from the Industry, working for leading organizations and have real world experience in JAVA. All these experienced folks are trained by ClassTree to provide online training so that they can provide great learning experience. We boast on the instructors we have with more than a decade of experience, years of hands-on experience at different world-class IT MNCs and they are dedicated to training career aspiring candidates with the best Java Training.','Corporate Trainer','9999999999',5,'formyscholars4u@gmail.com','-330',NULL,'2020-06-03 19:07:05','2020-06-06 16:53:28'),(180,'large','online','I am an mtech mba postgraduate i have worked in software companies and have taught many students in diverse streams and subjects java c++ microprocessor python ','Shubhajoy das','6290470434',5,'shubhajoydas@rocketmail.com','-330',NULL,'2020-06-08 03:46:00','2020-06-08 03:46:00'),(181,'large','online','<div data-purpose=\"safely-set-inner-html:trusted-html:content\"><p>He is a 31&nbsp;year old entrepreneur ,data scientist&nbsp; and data analytics / visual analytics&nbsp;consultant. He holds a master degree and is certified in Power BI as well as a Qualified Associate in Tableau software. He is currently working in Business Intelligence field and helps major companies to get key insights from their data to deliver long term growth and outpace their competitors.</p><p>He is committed to support other people by offering them educational services to help them accomplishing their goals and becoming the best in their profession or explore a new career path.</p><p>\"Helping others is the greatest joy\"</p><p>\"In order to do the impossible you need to see the invisible\"</p><p>\"If you dont like where you are then change. Life is too short!\"&nbsp;</p><p>You can do it!</p></div>','Corporate Trainer','7828345328',5,'tableau20@gmail.com','-330',NULL,'2020-06-11 08:55:49','2020-06-11 11:49:04'),(183,'zero','online','I am IIT certified machine learning/data science/artificial intelligence trainer.  I train students in major institutions.  Overall I have 6 years of training experience. ','Shravan Kumar Veldurthi','8105778745',5,'shravan.veldurthi@gmail.com','-330',NULL,'2020-06-15 06:21:18','2020-06-15 06:21:18'),(184,'zero','online','I want to teach how to improve a website by hacking the website without harming much\nI want to teach how to improve a website by hacking the website without harming I want to teach how to improve a website by hacking the website without harming much','Hack1','987654321',5,'hack1@gmail.com','420',NULL,'2020-06-20 14:13:39','2020-06-20 14:13:39'),(185,'small','professional','I am seasoned management professional and entrepreneur with versatile experience over 7+ years in managing business, data science consulting and leading innovation projects, bringing business ideas to working real world solutions. ','Fahad','8825095803',5,'hazarifahad@gmail.com','-330',NULL,'2020-06-21 05:34:59','2020-06-21 05:34:59');
